import React from "react";
import Input from "../../../../ui/Input";
import Label from "../../../../ui/Label";

export default function FormElement({
  labelFor,
  labelText,
  inputType,
  inputName,
  inputId,
  inputRequired
}) {
  return (
    <div className="FormElement">
      <Label htmlFor={labelFor} text={labelText} />
      <span>
        <Input
          type={inputType}
          id={inputId}
          name={inputName}
          required={inputRequired}
        />
      </span>
    </div>
  );
}
